INSERT INTO `landing_page` (`lan_id`, `lan_image`, `lan_title`, `lan_subtitle`, `lan_status`, `lan_colour`, `lan_order`) VALUES
(2, '0f9b1-maulidulrasul.jpg', 'Maulid Nabi MUHAMMAD', ' Sallallahu Alayhi Wasallam (SAW) <BR> " His birth was a light in the dark, His preach was an oasis in the dessert, His sacrifice was a bright moon in the lightless night "', 2, '1', 2),
(3, 'a55db-maalhijrah.jpg', 'SALAM MAAL HIJRAH (1437H)', 'It''s not difficult to change, the difficulties come within us. <br/> Begin with a step. Be the change. Salam Maal Hijrah. ', 2, '2', 3),
(4, 'ee8e3-makkah.jpg', 'EID ADHA MUBARAK', 'May the devine blessings of Allah fill your home and heart with the spirit of joy and open up newer opportunities for success.', 2, '2', 4),
(5, 'e6a76-untitled-1.jpg', 'Welcome Ramadhan', '', 2, '1', 2),
(6, 'c2570-rejab.jpg', 'Rajab is Allah''s month', 'Sha''aban my month & Ramadhan the month of my Ummah whosoever fasts a day in the month of Rajab will  be granted the great reward of Ridwan (an angle in heaven); the warth of Allah shall be distance and a door of the hell shall be closed. - Holy Prophet (saw)', 2, '1', 5),
(7, '57a41-187cfc2e3fdc890e2ab7b3678bc97ee1.600x.jpg', 'Isra and Mi’raj ', 'The month of Rajab is most famous for the incident of the night journey and ascension of Prophet SAW to the heavens, in Arabic known as Al-Isra wal Mi’raj.  The exact date of this journey is unknown, however all Islamic scholars are in agreement that it took place in the month of Rajab. Al-Isra refers to Prophet SAW’s journey to Jerusalem where he led all the previous prophets in prayer, and Mi’raj refers to his journey to the heavens.  This miraculous journey is very significant and has a direct impact on the daily lives of Muslims. It was during this journey that our Prophet SAW had the glimpses of wonders of paradise and torture of hellfire and was granted the gift of Salah (obligatory prayers).  - Stay close to anything good that reminds you of Allah.', 2, '1', 6),
(8, '2a7b7-ayers-rock-australia.jpg', 'Welcome Sya''aban', 'Sha''ban is the door to the month of Ramadan . Whoever seeks to familiarize themselves vigorously in worship in this month , Allah will reap success in the month of Ramadan . As Imam al - Misri Dzunnun once said : " Rajab is the month for planting , watering and Sha''ban is the month of Ramadan is the month of harvest ( harvest ) . "', 1, '1', 7),
(9, '81b9b-syaaban2.jpg', 'Forgiveness and Grace Full Night', 'Siti Aisyah Ra. said: "One night I lost the Prophet. So I find it. Apparently he was in Baqi as he lifted his face to the sky. He said: "Do you (she) will be wasted worry Allah and His Messenger?" I said: "O Messenger of Allah, I think you''re visiting some of your wives." Prophet. said: "Allah took to the world on the night of Sha''ban and forgives my Ummah Nishfu more of the Bani Kalb shear his sheep." (HR. Ahmad, Ibn Majah and ', 1, '1', 8),
(10, 'e16df-151006-places-to-see-before-you-die-san-francissco.jpg', 'sha''ban fasting and the advantages', 'Prophet Muhammad was asked by Osama bin Zaid why the Prophet preferred to fast Sha''ban. The Prophet replied by saying: "That Sha''ban is the month that is always overlooked by humans, while in Sha''ban all human practices raised to Allah. And I really like it when I lifted my deeds in a state of fasting. "(Narrated by An-Nasa''i and Ahmad.)', 1, '1', 10),
(11, '68a00-northern-lights-4-of-4.jpg', 'Ramadan Mubarak', 'Wishing you 1 month of ramadan, 4 weeks of barkat, 30 days of forgiveness, 720 hours of guidance, 43200 minutes of purification, 2592000 secs of Nuur..!!!', 2, '1', 11),
(12, '1f06b-beautiful-sunset-hd-wallpapers8.jpg', 'Ramadan Kareem', 'In this Holy month of Ramadan, may you be blessed with good health, prosperity and may Allah''s Blessings always shine upon you!', 2, '1', 12),
(13, 'e07d0-ramadan.jpg', 'Happy Ramadan', 'May the spirit of Ramadan stay in our hearts and illuminate our souls from within.', 2, '1', 13);
